import classes from './Input.module.css';
const Input = (props)=>{
  //  console.log(props.label);
 return (
    <div className={classes.input}>
        <label htmlFor='Amount'>{props.label}</label>
        <input  id="Amount" 
                type='number' 
                min='1' 
                max='5' 
                step='1'
                defaultValue='1'      
             />
    </div>
 );
};

export default Input();
